import React, {Component, Fragment} from 'react';

class App extends Component {
    constructor() {
        super();
        this.state = {
            stan: 0
        }
    }

    render() {
        return(
            <Fragment>
                <div className='game-header'>TIC - TAC - TOE</div>
            </Fragment>
        )
    }

}

export default App;
